import React from 'react';
import '../style/notesstyles.css';
import GradientHeader from '../components/GradientHeader';
import {StandardButton} from '../components/Buttons';

const Notes = () => {
return (
  <div className="container">
    <GradientHeader title="Notes"/>
    <StandardButton text="Ab Workout"/>
    <StandardButton text="2024 Goals"/>
    <StandardButton text="Feedback from trainer"/>
    <StandardButton text="Push Day Workout"/>
    <StandardButton text="Pull Day Workout"/>
    <StandardButton text="Leg Day Workout"/>
  </div>
  )
};



export const NotesHome = () => {
  return (
    <div id="notes_home">

    </div>
  )
}

export default Notes;
